import React from "react";
import HeroForm from "./SubmitForm";
import "./Description.css";
const HeroLeftside = () => {
  return (
    <div>
      <div className="hero-leftside">
        <h1 className="hero-leftside-head">
          Vehicle Maintenance From The Comfort of Your Home
        </h1>
        <p className="hero-leftside-subhead">
          Open Auto Soothes the hassle of maintaining your vehicle and helps you
          deal with unexpected repairs worry free.
        </p>
        <HeroForm />
      </div>
      <div></div>
    </div>
  );
};

export default HeroLeftside;
